/**
 * @file
 * Defines the Region Switcher functionality.
 */

(function ($, Drupal, drupalSettings) {

  'use strict';

  Drupal.behaviors.regionSwitcher = {

    attach: function (context, settings) {

      /**
       * General initialization of region switch functionality.
       */
      const init = function () {

        // Identify whether to display the "Reset Redirect Preference" link.
        let autoRedirect = localStorage.getItem('automaticRedirect');
        if (autoRedirect) {
          initRedirectReset(autoRedirect);
        }
      };

      /**
       * Initialize the redirect reset link and inject html for modal.
       *
       * @param {String} autoRedirect
       *   Value of automatic redirect preference.
       */
      const initRedirectReset = function(autoRedirect) {
        $('.region-redirect-reset-link').removeClass('hidden');
        $('.modal-redirect-reset-copy').text(settings.clearRedirectSettings[autoRedirect]);

        // Clear automatic redirect preferences on appropriate button click.
        $('.clear-preference-link').click(function (e) {
          e.preventDefault();

          localStorage.removeItem('automaticRedirect');
        });
      };

      // Initialise the functionality.
      init();
    }
  };

}(jQuery, Drupal, window.drupalSettings));
