var mainStateList = [], postState = '', postCountry = '';
(function($) {
  $(function () {
    $.getJSON("/modules/custom/cvent_marketo/js/statelist.js", function (data) { // Binding countries to drop down
      $.each(data.stateList, function (text, value) {
        mainStateList.push({
          val  : TrimString(value.stateCode.toUpperCase()),
          text : TrimString(value.stateName),
          title: TrimString(value.countryCode.toUpperCase())
        });
      });
      mainStateList.sort(function (a, b) {
        if (a.text > b.text) {
          return 1;
        }
        else if (a.text === b.text) {
          return 0;
        }
        else {
          return -1;
        }
      });
    });
  });
}(jQuery));


function TrimString(sInString) {
  if (sInString) {
    sInString = sInString.replace(/^\s+/g, "");
    return sInString.replace(/\s+$/g, "");
  }
}

function populateCountry(defaultCountry) {
  if (postCountry !== '') {
    defaultCountry = postCountry;
  }
  var countryFavorite = [], country = [], mainCountryList = [];

  var lang = drupalSettings.path.currentLanguage;
  if (lang === 'en' || lang ==='en-GB' || lang==='en-AU' || lang==='en-SG' || lang==='en-AE' || lang==='en-IN') {
    lang = '';
  } else if(lang !== '') {
    lang = '_' + lang;
  }

  // Load the translated countrylist json file, appended with the language name
  var countryListFilename = 'countrylist' + lang + '.js';


  $.getJSON("/modules/custom/cvent_marketo/js/" + countryListFilename, function (data) { // Binding countries to drop down
    processCountry(data);
  }).fail(function(){
    // Unable to get the json of the country file, load the default here
    $.getJSON("/modules/custom/cvent_marketo/js/countrylist.js", function (data) { // Binding countries to drop down
      processCountry(data);
    })
  });

  function processCountry(data) {
    $.each(data.countryList, function (text, value) {
      if (value.countryFavorite.length > 0) {
        countryFavorite.push({
          val : TrimString(value.countryCode.toUpperCase()),
          text: TrimString(value.countryName)
        });
      }
      else {
        country.push({
          val : TrimString(value.countryCode.toUpperCase()),
          text: TrimString(value.countryName)
        });
      }
    });
    country.sort(function (a, b) {
      if (a.text > b.text) {
        return 1;
      }
      else if (a.text === b.text) {
        return 0;
      }
      else {
        return -1;
      }
    });
    countryFavorite.sort(function (a, b) {
      if (a.text > b.text) {
        return 1;
      }
      else if (a.text === b.text) {
        return 0;
      }
      else {
        return -1;
      }
    });
    countryFavorite.push({
      val : 'DIVIDER',
      text: '----------'
    });
    mainCountryList = countryFavorite.concat(country);
    var selObj = document.getElementById('cvent_mrkto_country_select');
    var selObj2 = document.getElementById('countrySelect2');

    if (selObj) {
      countryList(selObj);
    }
    if (selObj2) {
      countryList(selObj2);
    }

    function countryList(cont) {
      cont.options[0] = new Option('Select Country', '');
      cont.selectedIndex = 0;
      for (var loop = 0; loop < mainCountryList.length; loop++) {
        if (mainCountryList[loop].val !== '') {
          if (mainCountryList[loop].val === 'DIVIDER') {
            (cont.options[loop + 1] = new Option('--------------------------------------------------', mainCountryList[loop].val)).setAttribute('disabled', true);
          }
          else {
            cont.options[loop + 1] = new Option(mainCountryList[loop].text, mainCountryList[loop].val);
          }
        }
        if (typeof defaultCountry !== 'undefined' && defaultCountry.toUpperCase() === mainCountryList[loop].val) {
          cont.selectedIndex = loop + 1;
        }
      }
    }
  }
}


function populateState() {
  var stl = document.getElementById('cvent_mrkto_state_select');
  var selObj2 = document.getElementById('stateSelect2');


  if (stl) {

    var foundState = false;
    if (stl.type === 'select-one') {
      for (var i = 0; i < stl.options.length; i++) {
        stl.options[i] = null;
      }
      stl.options.length = null;
      stl.options[0] = new Option('Select state / province', '');
      stl.selectedIndex = 0;
    }

    var optionCntr = 1;
    for (var loop = 0; loop < mainStateList.length; loop++) {
      if (document.getElementById('cvent_mrkto_country_select').value === mainStateList[loop].title && mainStateList[loop].title !== '') {
        if (stl.type === 'text') {
          parentObj = document.getElementById('cvent_mrkto_state_select').parentNode;
          parentObj.removeChild(stl);
          var inputSel = document.createElement("SELECT");
          inputSel.setAttribute("name", "state");
          inputSel.setAttribute("id", "cvent_mrkto_state_select");
          parentObj.appendChild(inputSel);
          stl = document.getElementById('cvent_mrkto_state_select');
          stl.options[0] = new Option('Select state / province', '');
          stl.selectedIndex = 0;
        }
        if (mainStateList[loop].val !== '') {
          stl.options[optionCntr] = new Option(mainStateList[loop].text, mainStateList[loop].val);
        }

        foundState = true;
        optionCntr++
      }
    }
    if (!foundState) {
      document.getElementById('cvent_mrkto_state_select').disabled = true;
    }
    else {
      document.getElementById('cvent_mrkto_state_select').disabled = false;
    }
  }
  if (selObj2) {

    var foundState = false;
    if (selObj2.type === 'select-one') {
      for (var i = 0; i < selObj2.options.length; i++) {
        selObj2.options[i] = null;
      }
      selObj2.options.length = null;
      selObj2.options[0] = new Option('Select state / province', '');
      selObj2.selectedIndex = 0;
    }

    var optionCntr = 1;
    for (var loop = 0; loop < mainStateList.length; loop++) {
      if (document.getElementById('countrySelect2').value === mainStateList[loop].title && mainStateList[loop].title !== '') {
        if (selObj2.type === 'text') {
          parentObj = document.getElementById('stateSelect2').parentNode;
          parentObj.removeChild(selObj2);
          var inputSel = document.createElement("SELECT");
          inputSel.setAttribute("name", "state");
          inputSel.setAttribute("id", "stateSelect2");
          parentObj.appendChild(inputSel);
          selObj2 = document.getElementById('stateSelect2');
          selObj2.options[0] = new Option('Select state / province', '');
          selObj2.selectedIndex = 0;
        }
        if (mainStateList[loop].val !== '') {
          selObj2.options[optionCntr] = new Option(mainStateList[loop].text, mainStateList[loop].val);
        }

        foundState = true;
        optionCntr++
      }
    }
    if (!foundState) {
      document.getElementById('stateSelect2').disabled = true;
    }
    else {
      document.getElementById('stateSelect2').disabled = false;
    }
  }


}

function initCountry(country) {
  populateCountry(country);
  setTimeout(function () {
    populateState();
  }, 1800);
}
