var ip_data;
function getPageQueryVariable(variable) {
  var query = decodeURIComponent(window.location.search.substring(1));
  var vars = query.split("&");
  for (var i = 0; i < vars.length; i++) {
    var pair = vars[i].split("=");
    if (pair[0] === variable) {
      return pair[1];
    }
  }
}

//Function to serialize post data
function serializePostData(formData){
  var len = formData.length;
  var dataObj = {};
  for (i=0; i<len; i++) {
    if(formData[i].name != 'token' && formData[i].name !='action'){
      dataObj[formData[i].name] = formData[i].value;
    }
  }
  return dataObj;
}

/**
 * returns a query component value
 * @param variableName
 * @returns {*}
 */
function returnQueryComponent(variableName) {
  var query = getPageQueryVariable(variableName);
  if (typeof query !== "undefined") {
    query = decodeURIComponent(query);
  }

  return query;
}

