/**
 * Append offerType values onto URLs
 * @param ty_url
 * @param offerTypeVal
 * @returns {*}
 */
function returnTYURLVal(ty_url, offerTypeVal) {
  if (offerTypeVal.length > 0) {
    var tyurlParts = ty_url.split('?');

    if (tyurlParts.length > 1) {
      var queryVars = tyurlParts[1].split('&');
      var finalQueryVars = [];
      var hasExistingOTValue = false;

      for (var n = 0; n < queryVars.length; n++) {
        var queryValue = queryVars[n].split('=');

        if (queryValue.length === 2) {
          finalQueryVars.push(queryValue[0] + '=' + queryValue[1]);
          if (queryValue[0] === 'ot') {
            hasExistingOTValue = true;
          }
        }

      }

      if (!hasExistingOTValue) {
        // This form did not have an existing OT value
        finalQueryVars.push('ot=' + offerTypeVal);
      }

      if (finalQueryVars.length > 0) {
        ty_url = tyurlParts[0] + '?' + finalQueryVars.join('&');
      } else {
        ty_url = tyurlParts[0];
      }


    } else {
      ty_url = ty_url + '?ot=' + offerTypeVal;
    }

  }

  return ty_url;
}


