/**===================================================

 !EU Opt-in

 ======================================================== */

function optIn(optIn) {
  if (typeof optIn === "undefined") {
    return; // console.error("@@optIn()@@: optIn parameter is undefined.");
  }
  else {
    if (optIn === true) {
      // Countries in the array will use the API
      var countryArray = ["US", "CA"];
      //var countryArray2 = ["CA"];
      var token = '63de90678e0e7c';
      // Make our AJAX call to ipinfo tool
      $.get("//ipinfo.io?token=" + token, function (data) {
        //Grab the country data from ipinfo
        var country = data.country;

        //If the country is in the array, remove the opt in box
        if (country === "US" && $.inArray(country, countryArray) > -1) {
          $(".opt-in-box, .c-address").hide();
        } else if (country === "CA" && $.inArray(country, countryArray) > -1) {
          $(".opt-in-box, .c-address").show();
          var $optInLabel = $(".opt-in-box").find("label"),
            optInLabelCopy = $optInLabel.html();
          $optInLabel.html(optInLabelCopy + "<br><br>Cvent, Inc. 1765 Greensboro Station Place<br>7thFloor, Tysons Corner, VA 22102");
        } else if (country === "GB" || country === "BE" || country === "FR" || country === "SE" || country === "NL") {
          $(".opt-in-box").show().addClass('opt-in-no-input');
          $(".opt-in-box").find("#cvent_mrkto_chkopt_ch").remove();
          $(".c-address").hide();
        } else {
          $(".opt-in-box").show();
          $(".c-address").hide();
        }
        //Ajax options
        $.ajaxSetup({cache: false, timeout: 10000});
      }, "jsonp");
    }
    else {
      $(".opt-in-box, .c-address").remove();
    }
  }
}

//function is to get url parameters
function $_GET(param) {
  var vars = {};
  window.location.href.replace( location.hash, '' ).replace(
    /[?&]+([^=&]+)=?([^&]*)?/gi, // regexp
    function( m, key, value ) { // callback
      vars[key] = value !== undefined ? value : '';
    }
  );

  if ( param ) {
    return vars[param] ? vars[param] : null;
  }
  return vars;
}
