/**
 * Adds change() handlers to hidden field mapping fields, allowing the mapped
 * fields to set the value of the hidden field
 *
 * @param mappedFieldName
 */
function addHiddenFieldMappingChangeHandler(mappedFieldName) {
  // Remove initial # if present, to normalize values
  mappedFieldName = mappedFieldName.replace(/^#/, '');
  mappedFieldName = '#' + mappedFieldName;

  // elementName is passed to this as an value, and contains the name of the parent element
  var elementName = this.elementName;

  var domElementType = $(mappedFieldName).prop('nodeName');

  if (domElementType === 'SELECT' || domElementType === 'INPUT') {
    $(mappedFieldName).change({elementName: elementName}, function(passedObj) {
      setHiddenFieldMappingValue(passedObj.data.elementName);
    });
  }  else if (domElementType === 'DIV') {
    // this id refers to a parent div, this is a checkbox element.
    // find all input children of this element
    var inputs = $(mappedFieldName).find(':input');

    inputs.map(function(){
      $(this).change({elementName: elementName}, function(passedObj) {
        setHiddenFieldMappingValue(passedObj.data.elementName);
      });
    });
  }
}

/**
 * Sets a hidden field value based on the fields mapped to it
 *
 * @param key
 */
function setHiddenFieldMappingValue(key) {
  var values = hiddenFieldMapping[key];

  var fieldValues = values.map(function(mappedFieldName) {
    // Remove initial # if present, to normalize values
    mappedFieldName = mappedFieldName.replace(/^#/, '');
    mappedFieldName = '#' + mappedFieldName;

    var domElementType = $(mappedFieldName).prop('nodeName');

    if (domElementType === 'SELECT' || domElementType === 'INPUT') {
      return $(mappedFieldName).val();
    }  else if (domElementType === 'DIV') {
      // this id refers to a parent div, this is a checkbox element.
      // find all input children of this element
      var inputs = $(mappedFieldName).find(':input');
      var fieldVal = [];

      for (var n=0; n < inputs.length; n++) {
        if ($(inputs[n]).is(':checked')) {
          fieldVal.push($(inputs[n]).val());
        }
      }
      return fieldVal.join();
    }
  });

  // Remove initial # if present, to normalize values
  var elementId = key.replace(/^#/, '');
  elementId = '#' + elementId;

  fieldValues = fieldValues.filter(Boolean);
  $(elementId).val(fieldValues.join());

}

